【ハウス おでんの素の詳細】<br>
●北海道産昆布と枕崎産かつお節がおいしさの決め手のおでんの素なので、おでん種そのものの旨さをより引き立たせることができます。<br>
●炊き込みごはんや煮物などにもお使い下さい。<br>
●6皿分が4袋入っています。<br><br>

【ご注意】<br>
○粉に含まれる黒い粒はかつおぶし加工品です。<br>
○内袋の開封後は早めにお使いください。<br><br>

【原材料】<br>
食塩、砂糖、しょう油、かつおぶし加工品、酵母エキス、こんぶエキス、植物油脂、調味料（アミノ酸等）、カラメル色素、（原材料の一部に小麦を含む）<br><br>

【栄養成分】1袋分（製品19.3g）の栄養成分あたり<br>
エネルギー：32kcaL、たん白質：2.4g、脂質：0.1g、炭水化物：5.3g、食塩相当量：4.4g<br><br>

【アレルギー物質】<br>
小麦、大豆<br><br>

【賞味期限】<br>
パッケージに記載<br><br>

【内容量】<br>
77.2g×5個<br><br>

